import React, { useState, useEffect } from "react";
import EachListItem from "./EachListItem";
import NavBar from "./NavBar";
import { Route , Switch } from 'react-router-dom'


export default function ItemsPage(props) {
  const [catalogList, setCatalogName] = useState([]);

  useEffect(() => {
    let temp = props.arrItems.filter(item =>{
      return item.type === props.typeOfCatalog;
    })
    setCatalogName(temp);
  },[]);

  return (
    <div>
      <NavBar Page="MainPageAfterLogin" toLink="/MainPage"/>
     <Switch>
         <ul>{catalogList.map(e=>{
        return  <EachListItem  Item={e} />
      })}</ul>

      </Switch>
    </div>
  );
}
